script: |
  super -f text -I q6326.spq | sort > q6326.out

inputs:
  - name: q6326.spq
    data: |
      SELECT DISTINCT - - cor1.col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q6326.out
    data: |
      86
      91
      97
